import React from 'react'
import braceletRing from './images/brace.jpg';

const Bracelet = () => {
  return (
    <div>
      <div className="slideshow-container">
        <img
          src={braceletRing}
          alt="Slideshow"
          className="slideshow-image"
        />
      </div>
    </div>
  )
}

export default Bracelet
